import React from "react";

const ModalNavBar = () => {
  return (
    <div className="modalNavBar--overview">
      <div className="top--section"></div>
      <div className="middle--section"></div>
      <div className="bottom--section"></div>
    </div>
  );
};

export default ModalNavBar;
